import React from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import Learningpath from "../assets/learningpath.png";

export default function Final() {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        minHeight: "100vh",
        textAlign: "center",
        padding: "0 20px",
      }}
    >
      <div>
        <h1
          style={{
            fontFamily: "Roboto",
            fontSize: "clamp(20px, 5vw, 30px)",
            fontWeight: "bold",
            marginBottom: "10px",
          }}
        >
          Learning paths based on your answers
        </h1>
        <p
          style={{
            fontFamily: "Roboto",
            fontSize: "clamp(16px, 4vw, 20px)",
            fontWeight: 500,
            color: "#6b7280",
          }}
        >
          Choose one to get started. You can switch anytime.
        </p>
        <div style={{ display: "flex", gap: "20px", marginTop: "40px" }}>
          {/* Card with "Most Popular" tag */}
          <div style={{ position: "relative" }}>
            <span
              style={{
                position: "absolute",
                top: "-15px",
                left: "50%",
                transform: "translateX(-50%)",
                backgroundColor: "#FFD700",
                padding: "5px 10px",
                borderRadius: "5px",
                color: "#fff",
                fontWeight: "bold",
                zIndex: 1,
              }}
            >
              Most Popular
            </span>
            <Card
              sx={{
                width: "450px",
                display: "flex",
                flexDirection: "row",
                justifyContent: "space-between",
                alignItems: "center",
              }}
            >
              {/* Left side - Description */}
              <CardContent style={{ flex: 1 }}>
                <Typography sx={{ fontSize: 14, textAlign: "left" }}>
                  <span style={{ fontFamily: "Roboto", fontWeight: "bold" }}>
                    Foundational Math{" "}
                  </span>
                  Build your foundational skills in algebra, geometry, and
                  probability.
                </Typography>
              </CardContent>
              {/* Right side - Image */}
              <img
                src={Learningpath}
                alt="Learningpath"
                style={{
                  width: "150px",
                  height: "150px",
                  objectFit: "cover",
                  margin: "20px",
                }}
              />
            </Card>
          </div>
          {/* Second Card */}
          <Card
            sx={{
              width: "450px",
              display: "flex",
              flexDirection: "row",
              justifyContent: "space-between",
              alignItems: "center",
            }}
          >
            {/* Left side - Description */}
            <CardContent style={{ flex: 1 }}>
              <Typography sx={{ fontSize: 14, textAlign: "left" }}>
                <span style={{ fontFamily: "Roboto", fontWeight: "bold" }}>
                  Mathematical Thinking{" "}
                </span>
                Build your foundational skills in algebra, geometry, and
                probability.
              </Typography>
            </CardContent>
            {/* Right side - Image */}
            <img
              src={Learningpath}
              alt="Learningpath"
              style={{
                width: "150px",
                height: "150px",
                objectFit: "cover",
                margin: "20px",
              }}
            />
          </Card>
        </div>
      </div>
    </div>
  );
}
